        "visibility": "public",
        "suggested_exercises": "[{\"id\":\"963cdf96-7aec-4d73-ad24-0eb9cf5476a9\",\"title\":\"Start och stopp i trafik\",\"description\":\"Öva på att starta och stanna mjukt vid trafikljus och korsningar. Fokusera på att inte rycka vid start, och att bromsa jämnt vid stopp.\\n\\n🛠 Instruktioner:\\n✅ Starta bilen smidigt utan att rycka.\\n✅ Bromsa mjukt och stanna vid stopplinje.\\n✅ Kontrollera speglar och döda vinkeln innan start.\",\"media\":[{\"type\":\"image\",\"url\":\"https://wbimxxrbzgynigwolcnk.supabase.co/storage/v1/object/public/route-attachments/759afd7c-ac64-46d2-b931-c5c4c43a11d6.png\"}]},{\"id\":\"8c945ee1-b947-415a-85f6-807e4d5e18e1\",\"title\":\"Svängar i korsningar\",\"description\":\"Träna på vänster- och högersvängar i korsningar. Se till att placera bilen rätt i filen och blinka i god tid.\\n\\n🛠 Instruktioner:\\n✅ Blinka minst 3 sekunder innan svängen.\\n✅ Kontrollera speglar och döda vinkel.\\n✅ Sakta in och sväng mjukt utan att överstyra.\"},{\"id\":\"68bb89bf-f7b7-4d5b-8a1a-fe2523401b3c\",\"title\":\"Rondellkörning\",\"description\":\"Kör genom minst 3 rondeller och fokusera på att välja rätt fil, anpassa hastigheten och ge tydliga signaler.\\n\\n✅ Välj rätt fil beroende på om du ska rakt fram, svänga vänster eller höger.\\n✅ Håll jämn hastighet och var beredd att bromsa om sikten är skymd.\\n✅ Blinka vid utfart.\"},{\"id\":\"e0d4ec2e-4e62-4236-92c3-84b4b841aec1\",\"title\":\"Backa och parkera\",\"description\":\"Öva på backning och parkering i en lugn miljö. Testa både fickparkering och att backa in i en ruta.\\n\\n✅ Backa långsamt och kontrollera speglarna.\\n✅ Håll koll på markeringar och referenspunkter för att få bra placering.\\n✅ Korrigera försiktigt om du hamnar snett.\"},{\"id\":\"9630cca1-6011-47f1-9dd6-e52599cfbb83\",\"title\":\"Motorväg – Accelerationsfält och filbyten\",\"description\":\"Träna på att köra in på motorväg via accelerationsfält och göra säkra filbyten.\\n\\n✅ Öka farten för att matcha trafikens hastighet.\\n✅ Kolla speglar och döda vinkeln innan du byter fil.\\n✅ Använd blinkers och gör en mjuk övergång till körfältet.\"}]",
